import React from "react"
import { useParams } from "react-router-dom"

const CatShow = ({ cats }) => {
   const { id } = useParams()
   let currentCat = cats.find((cat) => cat.id === +id)
   console.log(currentCat)

   return (
      <>
         <h3>Cat Show Page</h3>
      </>
   )
}

export default CatShow
